        <>
            <form style={{width: "100%", height: 517, background: "green", position: "relative", top: 30}}>
                {showData ? <AccountData/> : <></>}
                {showOrder ? <h5>Поточне замовлення</h5> : <></>}
                {showHistoryOrder ? <h5>Історія замовленнь</h5> : <></>}
            </form>
        </>
    );
};

export default AccountList;
